long double erfh(long double x)
{
    
	// Ivan A. Skvortov, April 2014.
    
	// Uses methods similar to the erfcx calculation:
	// continued fractions for large |x|,
	// a lookup table of Chebyshev polynomials for smaller |x|,
	// and finally a Taylor expansion for |x|<0.01.

	if (x >= 0) {
		if (x > 45) { // continued-fraction expansion is faster
			if (x > 5e7) // 1-term expansion, important to avoid overflow
				return 1. / ( 2 * x ) ;
			/* 7-term expansion (rely on compiler for CSE), simplified from:
			0.5 / (x-0.5/(x-1/(x-1.5/(x-2/(x - 2.5 /( x -3/x))))) */
			return  (( x*x ) * ( (x*x) * ( x*x - 10. ) + 21.75 ) - 6 ) /( x * ( (x*x) * ( (x*x) * ( 2*(x*x) - 21. ) + 52.5 ) - 26.25 ) );
		}
		return erfh_y100(100/(1+x), x);
	}
	else { // = erfh(-x)
		if (x < -45) { // continued-fraction expansion is faster
			if (x < -5e7) // 1-term expansion, important to avoid overflow
				return -1. / ( 2 * x );
			/* 7-term expansion (rely on compiler for CSE), simplified from:
			0.5 / (x-0.5/(x-1/(x-1.5/(x-2/(x - 2.5 /( x -3/x))))) */
			return  (( x*x ) * ( (x*x) * ( x*x - 10. ) + 21.75 ) - 6 ) /( -x * ( (x*x) * ( (x*x) * ( 2*(x*x) - 21. ) + 52.5 ) - 26.25 ) );
		}
		return erfh_y100(100/(1-x), -x);
	}
}

